import { useState ,useEffect } from "react";
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import { Typography } from "@mui/material";



const Input = ({setValue , value }) => {
    const [input , setInput ] = useState('')

  const handleChange = (e) => {
    let inputValue = e.target.value;
    // Remove non-numeric characters
    inputValue = inputValue.replace(/[^0-9]/g,'');

    // Ensure the value is within the range of 1 to 20
    if (inputValue !== '' && parseInt(inputValue) >= 1 && parseInt(inputValue) <= 20) {
      setInput(inputValue);
    }
//     else {
//     //   // Clear the input if the value is not within the range
//     //   setValue('');
//     // }

 };


  function handleclick(){
    let inputValue = input; 
    setValue(inputValue);
}

  return (
    <div style={{marginTop : '10px' , display: 'flex' ,justifyContent:'flex-start' , alignItems:'center'}}>
      <label htmlFor="numberInput"><Typography variant="h5">Enter a number (1-20): </Typography></label>
      <TextField
        label="Enter text"
        variant="outlined"
        onChange={handleChange}
        style={{ marginBottom: '20px' }}
      />
      <Button variant="contained" onClick={handleclick}>
        Click
      </Button>
    </div>
  );
};


export default Input;
